Array types
In PHP, the array type is commonly used to represent three different data structures:
List):

Associative array:  
 'hello', 5 => 'goodbye'];
$b = ['a' => 'AA', 'b' => 'BB', 'c' => 'CC']

Makeshift Structs):
 'Psalm', 'type' => 'tool'];

PHP treats all these arrays the same, essentially (though there are some optimisations under the hood for the first case).
Psalm has a few different ways to represent arrays in its type system:
Generic arrays
Psalm uses a syntax borrowed from Java that allows you denote the types of both keys and values:
/** @return array */

You can also specify that an array is non-empty with the special type non-empty-array.
PHPDoc syntax
PHPDoc allows you to specify the  type of values a generic array holds with the annotation:
/** @return ValueType[] */

In Psalm this annotation is equivalent to @psalm-return array.
Generic arrays encompass both associative arrays and lists.
Lists
(Psalm 3.6+)
Psalm supports a list type that represents continuous, integer-indexed arrays like ["red", "yellow", "blue"] .
These arrays have the property $arr === array_values($arr), and represent a large percentage of all array usage in PHP applications.
A list type is of the form list,  where SomeType is any permitted union type supported by Psalm.

list is a subtype of array
