When Psalm handles the return type of $my_container->getValue() it doesn't know what it's getting out, because the value can be arbitrary.
Templated annotations provide us with a workaround - we can define a generic/templated param T that is a placeholder for the value inside MyContainer:
value = $value;
  }

  /** @return T */
  public function getValue() {
    return $this->value;
  }
}

Now we can substitute values for that templated param when we reference MyContainer in docblocks e.g. @return MyContainer. This tells Psalm to substitute T for int when evaluating that return type, effectively treating it as a class that looks like
